                assignment_group: 'AG_Company-MPNexlevel'
            },
            'Ultipro': {
                short_description: 'ULTIPRO.SEC05 Deprovision Ultipro Access',
                description: defaultDeprovisionShortDescription,
                assignment_group: 'AG_MPNexlevelPayroll'
            },
            'Visual Lease': {
                short_description: 'VL.SEC05 Deprovision Visual Lease Access',
                description: defaultDeprovisionShortDescription,
                assignment_group: 'AG_VisualLease'
            },
            'Wolffware': {
                short_description: 'WW.SEC05 Deprovision Wolffware',
                description: defaultDeprovisionShortDescription,
                assignment_group: 'AG_Company-MPNexlevel'
            }
        }
    }



    //Set access type, it comes in as 0 for remove, 1 for new
    var accType = '';
    if (inputs.access_type == 0) {
        accType = 'Deprovision';
    }
    else if (inputs.access_type == 1) {
        accType = 'Provision';
    }
    var target = accessLookups[accType];
    var gr = new GlideRecord('sc_req_item');
    gr.get(inputs.ritm);

    //If there are approvals, set approval outputs
    if (target[inputs.access_name] != null && target[inputs.access_name]['approval'] != null && target[inputs.access_name]['approval']['approvalType'] && target[inputs.access_name]['approval']['approvalGroup']) {
        var curApproval = target[inputs.access_name].approval;
        outputs.is_approval = true;
        outputs.approval_type = curApproval['approvalType'];//Cascading or Group
        outputs.approval_group = curApproval['approvalGroup'];
    }
    else {
        outputs.is_approval = false;
    }
    //If there are 2 steps(tasks) to follow, set step 2 outputs then prep "target" for setting step 1
    if (target[inputs.access_name].step1 && target[inputs.access_name].step2) {
        var curTarget1 = target[inputs.access_name].step1;
        var curTarget2 = target[inputs.access_name].step2;

        outputs.short_description2 = curTarget2.short_description + ' Access - Access Request - ' + gr.requested_for.name;
        outputs.description2 = curTarget2.description;
        outputs.assignment_group2 = curTarget2.assignment_group;

        outputs.second_task_needed = true;
        outputs.short_description = curTarget1.short_description + ' Access - Access Request - ' + gr.requested_for.name;
        outputs.description = curTarget1.description;
        outputs.assignment_group = curTarget1.assignment_group;

        outputs.ritm_short_description = curTarget2.short_description + ' Access - Access Request - ' + gr.requested_for.name;
        outputs.ritm_description = curTarget2.description;
        outputs.ritm_assignment_group = curTarget2.assignment_group;
    }
    //Prep "target" for processes that aren't 2 step
    else {
        //Set values for task, if it doesn't exist then build it out like a regular access request used to be
        if (target[inputs.access_name]) {
            target = target[inputs.access_name];
            outputs.short_description = target.short_description + ' Access - Access Request - ' + gr.requested_for.name;
            outputs.description = target.description;
            outputs.assignment_group = target.assignment_group;

            outputs.ritm_short_description = target.short_description + ' Access - Access Request - ' + gr.requested_for.name;
            outputs.ritm_description = target.description;
            outputs.ritm_assignment_group = target.assignment_group;
        }
        //If access_name isnt in object above
        else {
            outputs.short_description = accType + ' ' + inputs.access_name + ' Access - Access Request - ' + gr.requested_for.name;
            outputs.description = ' ';
            outputs.assignment_group = gr.cat_item.group.name;

            outputs.ritm_short_description = accType + ' ' + inputs.access_name + ' Access - Access Request - ' + gr.requested_for.name;
            outputs.ritm_description = ' ';
            outputs.ritm_assignment_group = gr.cat_item.group.name;
        }
    }
})(inputs, outputs);

